	"password": password,
	"emailAddress": emailAddress,
	"displayName": displayName,
	"name": username
};
gs.info("remdey body"+remedy_body);
var querypara=username;
var checkuser=callgetmethod(querypara);
if(checkuser!=200 || checkuser!==201)
	{
	var stat=callpostmethod(remedy_body);
	{
		workflow.scratchpad.temp=stat.toString();
		if(stat==200 || stat==201)
			{
			current.work_notes="add user to jira successful";
		}
		else{
			current.work_notes="add user to jira failed";
		}
	}
	
}

function callgetmethod(querypara)
{
	try {
		gs.info('Execution get Method');
		var r = new sn_ws.RESTMessageV2('x_14768_user_servi.Add User to Jira Cloud', 'Default GET');
		r.setQueryParameter('username',querypara);
		var response = r.execute();
		var responseBody = response.getBody();
		var httpStatus = response.getStatusCode();
		gs.info('Execution get Method status' +httpStatus);
		return httpStatus;
	}
	catch(ex) {
		var message = ex.message;
		gs.info('Execution get Method error' +message);
		return 0;
	}
}
